import React, { useHistory } from 'react';

const SuccessPage = () => {
    const {history} = useHistory();

    const onClick = (e) => {
        e.prevent.default();
        localStorage.removeItem('items');
        history.push('/products')
        
    }
    return (
        <div>
            <h1>Thanks for Renting</h1>
                <button onClick={onClick}>Back</button>
        </div>
    )
}

export default SuccessPage;
